import{d as t}from"./app.058e2587.js";import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";const l={},d=t('<h1 id="\u110C\u1175\u110B\u1169\u11A8" tabindex="-1"><a class="header-anchor" href="#\u110C\u1175\u110B\u1169\u11A8" aria-hidden="true">#</a> \uC9C0\uC625</h1><h2 id="\u1109\u1169\u1100\u1162" tabindex="-1"><a class="header-anchor" href="#\u1109\u1169\u1100\u1162" aria-hidden="true">#</a> \uC18C\uAC1C</h2><h2 id="\u110C\u1175\u110B\u1169\u11A8\u110B\u1175-\u110B\u1165\u11AB\u1100\u1173\u11B8\u1103\u116C\u11AB-\u1109\u1165\u11BC\u1100\u1167\u11BC-\u1106\u1161\u11AF\u110A\u1173\u11B7" tabindex="-1"><a class="header-anchor" href="#\u110C\u1175\u110B\u1169\u11A8\u110B\u1175-\u110B\u1165\u11AB\u1100\u1173\u11B8\u1103\u116C\u11AB-\u1109\u1165\u11BC\u1100\u1167\u11BC-\u1106\u1161\u11AF\u110A\u1173\u11B7" aria-hidden="true">#</a> \uC9C0\uC625\uC774 \uC5B8\uAE09\uB41C \uC131\uACBD \uB9D0\uC500</h2><details class="custom-container details"><summary>\uD3BC\uCE58\uAE30</summary><table><thead><tr><th style="text-align:left;">\uB9D0\uC500</th><th style="text-align:left;">\uB0B4\uC6A9</th></tr></thead><tbody><tr><td style="text-align:left;">\uC2E0\uBA85\uAE30 32:22</td><td style="text-align:left;">\uB0B4 \uC9C4\uB178 \uC911\uC5D0 \uBD88\uC774 \uBD99\uC5B4\uC11C \uAC00\uC7A5 \uB0AE\uC740 \uC9C0\uC625\uAE4C\uC9C0 \uC0AC\uB97C \uAC83\uC774\uBA70 \uB545\uC744 \uADF8 \uC18C\uC0B0\uACFC \uB354\uBD88\uC5B4 \uC18C\uBA78\uD560 \uAC83\uC774\uBA70 \uC0B0\uB4E4\uC758 \uAE30\uCD08\uC5D0\uB3C4 \uBD88\uC744 \uB193\uC73C\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC0AC\uBB34\uC5D8\uD558 22:6</td><td style="text-align:left;">\uC9C0\uC625\uC758 \uC2AC\uD514\uC774 \uB098\uB97C \uC5D0\uC6CC\uC30C\uC73C\uBA70 \uC0AC\uB9DD\uC758 \uC62C\uBB34\uAC00 \uB0B4 \uC55E\uC5D0 \uC788\uC5C8\uB3C4\uB2E4.</td></tr><tr><td style="text-align:left;">\uC6A5\uAE30 11:8</td><td style="text-align:left;">\uADF8\uAC83\uC740 \uD558\uB298\uB9CC\uD07C \uB192\uC73C\uB2C8 \uB124\uAC00 \uBB34\uC5C7\uC744 \uD558\uACA0\uC73C\uBA70, \uC9C0\uC625\uBCF4\uB2E4 \uAE4A\uC73C\uB2C8 \uB124\uAC00 \uC5B4\uCC0C \uC54C \uC218 \uC788\uACA0\uB290\uB0D0?</td></tr><tr><td style="text-align:left;">\uC6A5\uAE30 26:6</td><td style="text-align:left;">\uC9C0\uC625\uB3C4 \uADF8 \uBD84 \uC55E\uC5D0\uB294 \uBC97\uACA8\uC9C0\uACE0 \uBA78\uB9DD\uB3C4 \uAC00\uB9AC\uC6C0\uC774 \uC5C6\uB290\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uC2DC\uD3B8 9:17</td><td style="text-align:left;">\uC545\uC778\uC740 \uC9C0\uC625\uC73C\uB85C \uB3CC\uB824\uC9C8 \uAC83\uC774\uC694, \uD558\uB098\uB2D8\uC744 \uC78A\uC5B4\uBC84\uB9B0 \uBAA8\uB4E0 \uBBFC\uC871\uB4E4\uB3C4 \uADF8\uB7EC\uD558\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC2DC\uD3B8 16:10</td><td style="text-align:left;">\uC774\uB294 \uC8FC\uAED8\uC11C \uB0B4 \uD63C\uC744 \uC9C0\uC625\uC5D0 \uBC84\uB824\uB450\uC9C0 \uC544\uB2C8\uD558\uC2DC\uBA70, \uC8FC\uC758 \uAC70\uB8E9\uD558\uC2E0\uC774\uB85C \uC369\uC5B4\uC9D0\uC744 \uBCF4\uC9C0 \uC54A\uAC8C \uD558\uC2E4 \uAC83\uC784\uC774\uB2C8\uC774\uB2E4.</td></tr><tr><td style="text-align:left;">\uC2DC\uD3B8 18:5</td><td style="text-align:left;">\uC9C0\uC625\uC758 \uACE0\uD1B5\uC774 \uB098\uB97C \uC5D0\uC6CC\uC2F8\uACE0 \uC0AC\uB9DD\uC758 \uB36B\uC774 \uB098\uB97C \uB9C9\uC558\uB098\uC774\uB2E4.</td></tr><tr><td style="text-align:left;">\uC2DC\uD3B8 55:15</td><td style="text-align:left;">\uC0AC\uB9DD\uC73C\uB85C \uADF8\uB4E4\uC744 \uB36E\uCE58\uAC8C \uD558\uACE0, \uADF8\uB4E4\uC744 \uAE09\uD788 \uC9C0\uC625\uC73C\uB85C \uB0B4\uB824\uAC00\uAC8C \uD560\uC9C0\uB77C. \uC774\uB294 \uC0AC\uC545\uD568\uC774 \uADF8\uB4E4\uC758 \uCC98\uC18C\uC5D0, \uB610 \uADF8\uB4E4 \uAC00\uC6B4\uB370 \uC788\uC74C\uC774\uB77C.</td></tr><tr><td style="text-align:left;">\uC2DC\uD3B8 86:13</td><td style="text-align:left;">\uC774\uB294 \uB098\uB97C \uD5A5\uD558\uC2E0 \uC8FC\uC758 \uC790\uBE44\uAC00 \uD06C\uC2DC\uBA70, \uC8FC\uAED8\uC11C \uB0B4 \uD63C\uC744 \uAC00\uC7A5 \uB0AE \uC740 \uC9C0\uC625\uC73C\uB85C\uBD80\uD130 \uAD6C\uD558\uC168\uC74C\uC774\uB2C8\uC774\uB2E4.</td></tr><tr><td style="text-align:left;">\uC2DC\uD3B8 116:3</td><td style="text-align:left;">\uC0AC\uB9DD\uC758 \uC2AC\uD514\uC774 \uB098\uB97C \uC5D0\uC6CC\uC2F8\uACE0 \uC9C0\uC625\uC758 \uACE0\uD1B5\uC774 \uB0B4\uAC8C \uBBF8\uCCE4\uC73C\uB2C8, \uB0B4\uAC00 \uACE0\uB09C\uACFC \uC2AC\uD514\uC744 \uB9CC\uB0AC\uB3C4\uB2E4.</td></tr><tr><td style="text-align:left;">\uC2DC\uD3B8 139:8</td><td style="text-align:left;">\uB0B4\uAC00 \uD558\uB298\uB85C \uC62C\uB77C\uAC08\uC9C0\uB77C\uB3C4 \uC8FC\uAED8\uC11C\uB294 \uAC70\uAE30 \uACC4\uC2DC\uBA70, \uB0B4\uAC00 \uC9C0\uC625\uC5D0 \uC7A0\uC790\uB9AC\uB97C \uB9C8\uB828\uD55C\uB2E4 \uD558\uC5EC\uB3C4, \uBCF4\uC18C\uC11C, \uC8FC\uAED8\uC11C\uB294 \uAC70\uAE30 \uACC4\uC2DC\uB098\uC774\uB2E4.</td></tr><tr><td style="text-align:left;">\uC7A0\uC5B8 5:5</td><td style="text-align:left;">\uADF8\uB140\uC758 \uBC1C\uC740 \uC8FD\uC74C\uC73C\uB85C \uB0B4\uB824\uAC00\uACE0, \uADF8\uB140\uC758 \uAC78\uC74C\uC740 \uC9C0\uC625\uC73C\uB85C \uC811\uC5B4\uB4DC\uB294\uB3C4\uB2E4.</td></tr><tr><td style="text-align:left;">\uC7A0\uC5B8 7:27</td><td style="text-align:left;">\uADF8\uB140\uC758 \uC9D1\uC740 \uC9C0\uC625\uC73C\uB85C \uAC00\uB294 \uAE38\uC774\uBA70 \uC8FD\uC74C\uC758 \uBC29\uB4E4\uB85C \uB0B4\uB824\uAC00\uB294 \uAE38\uC774\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uC7A0\uC5B8 9:18</td><td style="text-align:left;">\uADF8\uB7EC\uB098 \uADF8\uB294 \uC8FD\uC740 \uC790\uAC00 \uAC70\uAE30 \uC788\uACE0, \uADF8\uB140\uC758 \uAC1D\uB4E4\uC774 \uC9C0\uC625\uC758 \uAE4A\uC740 \uACF3\uB4E4\uC5D0 \uC788\uB294 \uAC83\uC744 \uC54C\uC9C0 \uBABB\uD558\uB290\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uC7A0\uC5B8 15:11</td><td style="text-align:left;">\uC9C0\uC625\uACFC \uBA78\uB9DD\uC774 \uC8FC \uC55E\uC5D0 \uC788\uAC70\uB298, \uD558\uBB3C\uBA70 \uC0AC\uB78C\uC758 \uC790\uC190\uB4E4\uC758 \uB9C8\uC74C\uB4E4\uC774\uC57C \uB354\uC6B1 \uADF8\uB807\uC9C0 \uC54A\uACA0\uB290\uB0D0?</td></tr><tr><td style="text-align:left;">\uC7A0\uC5B8 15:24</td><td style="text-align:left;">\uC0DD\uBA85\uC758 \uAE38\uC740 \uD604\uBA85\uD55C \uC790 \uC704\uC5D0 \uC788\uC73C\uB2C8, \uADF8\uB294 \uC544\uB798 \uC788\uB294 \uC9C0\uC625\uC73C\uB85C\uBD80\uD130 \uBC97\uC5B4\uB098\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC7A0\uC5B8 23:14</td><td style="text-align:left;">\uB108\uB294 \uADF8\uB97C \uB9E4\uC9C8\uD574\uC57C \uD558\uB9AC\uB2C8, \uADF8\uB9AC\uD558\uBA74 \uADF8\uC758 \uD63C\uC744 \uC9C0\uC625\uC73C\uB85C\uBD80\uD130 \uAD6C\uD574 \uB0B4\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC7A0\uC5B8 27:20</td><td style="text-align:left;">\uC9C0\uC625\uACFC \uBA78\uB9DD\uC740 \uACB0\uCF54 \uAC00\uB4DD \uCC28\uC9C0 \uC54A\uC73C\uBA70, \uC0AC\uB78C\uC758 \uB208\uB3C4 \uACB0\uCF54 \uB9CC\uC871\uD568 \uC774 \uC5C6\uB290\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uC774\uC0AC\uC57C 5:14</td><td style="text-align:left;">\uC9C0\uC625\uC740 \uC2A4\uC2A4\uB85C\uB97C \uD655\uC7A5\uD558\uC600\uACE0 \uD55C\uC5C6\uC774 \uC785\uC744 \uBC8C\uB838\uC73C\uB2C8, \uADF8\uB4E4\uC758 \uC601\uAD11\uACFC, \uADF8\uB4E4\uC758 \uB9CE\uC740 \uBB34\uB9AC\uC640, \uADF8\uB4E4\uC758 \uD5C8\uC601\uACFC, \uAE30\uBED0\uD558\uB294 \uC790\uAC00 \uADF8 \uACF3\uC73C\uB85C \uB0B4\uB824\uAC00\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC774\uC0AC\uC57C 14:9</td><td style="text-align:left;">\uC544\uB798\uB85C\uBD80\uD130 \uC9C0\uC625\uC774 \uB108\uB85C \uC778\uD558\uC5EC \uC6C0\uC9C1\uC5EC\uC11C \uB124\uAC00 \uC62C \uB54C \uB108\uB97C \uB9DE\uC774\uD558\uB824 \uD558\uB294\uB3C4\uB2E4. \uADF8\uAC83\uC774 \uB108\uB85C \uC778\uD558\uC5EC \uC8FD\uC740 \uC790\uB4E4\uC744 \uC6C0\uC9C1\uC774\uB2C8, \uACE7 \uB545\uC758 \uBAA8\uB4E0 \uC9C0\uB3C4\uC790\uB4E4\uC774\uB77C. \uB610 \uADF8\uAC83\uC774 \uBBFC\uC871\uB4E4\uC758 \uBAA8\uB4E0 \uC655\uB4E4\uC744 \uADF8\uB4E4\uC758 \uBCF4\uC88C\uC5D0\uC11C \uC77C\uC5B4\uC11C\uAC8C \uD558\uC600\uB3C4\uB2E4.</td></tr><tr><td style="text-align:left;">\uC774\uC0AC\uC57C 14:15</td><td style="text-align:left;">\uADF8\uB7EC\uB098 \uB108\uB294 \uC9C0\uC625\uAE4C\uC9C0 \uB04C\uC5B4\uB0B4\uB824\uC9C8 \uAC83\uC774\uC694, \uAD6C\uB801\uC758 \uC0AC\uBA74\uC5D0\uAE4C\uC9C0 \uB04C\uC5B4\uB0B4\uB824\uC9C0\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC774\uC0AC\uC57C 28:15</td><td style="text-align:left;">\uB108\uD76C\uAC00 \uB9D0\uD558\uAE30\uB97C &quot;\uC6B0\uB9AC\uAC00 \uC0AC\uB9DD\uACFC \uB354\uBD88\uC5B4 \uC5B8\uC57D\uC744 \uB9FA\uC5C8\uACE0 \uC6B0\uB9AC\uAC00 \uC9C0\uC625\uACFC \uB354\uBD88\uC5B4 \uD569\uC758\uD558\uC600\uB3C4\uB2E4. \uB118\uCE58\uB294 \uC7AC\uC559\uC774 \uC9C0\uB098\uAC08\uC9C0\uB77C\uB3C4 \uC6B0\uB9AC\uC5D0\uAC8C \uC784\uD558\uC9C0 \uBABB\uD558\uB9AC\uB2C8, \uC774\uB294 \uC6B0\uB9AC\uAC00 \uAC70\uC9D3\uC744 \uC6B0\uB9AC\uC758 \uD53C\uB09C\uCC98\uB85C \uC0BC\uC558\uACE0 \uD5C8\uC704 \uC544\uB798 \uC6B0\uB9AC\uAC00 \uC6B0\uB9AC \uC790\uC2E0 \uC744 \uC228\uACBC\uC74C\uC774\uB77C.&quot; \uD558\uC600\uB3C4\uB2E4.</td></tr><tr><td style="text-align:left;">\uC774\uC0AC\uC57C 28:18</td><td style="text-align:left;">\uC0AC\uB9DD\uACFC \uB354\uBD88\uC5B4 \uB9FA\uC740 \uB108\uD76C\uC758 \uC5B8\uC57D\uC774 \uBB34\uD6A8\uD654\uB418\uBA70 \uC9C0\uC625\uACFC \uD55C \uB108\uD76C\uC758 \uD569\uC758\uAC00 \uC11C\uC9C0 \uBABB\uD558\uB9AC\uB2C8, \uB118\uCE58\uB294 \uC7AC\uC559\uC774 \uC9C0\uB098\uAC00\uBA74 \uB108\uD76C\uAC00 \uADF8\uAC83\uC5D0 \uC9D3\uBC1F\uD798\uC744 \uB2F9\uD558\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC774\uC0AC\uC57C 57:9</td><td style="text-align:left;">\uB124\uAC00 \uD5A5\uAE30\uB984\uC744 \uAC00\uC9C0\uACE0 \uC655\uC5D0\uAC8C\uB85C \uAC14\uC73C\uBA70 \uB124 \uD5A5\uC218\uB97C \uB298\uB9AC\uACE0 \uB610 \uB124 \uC0AC\uC790\uB4E4\uC744 \uBA40\uB9AC \uBCF4\uB0B4\uC11C \uC2A4\uC2A4\uB85C\uB97C \uC9C0\uC625\uC5D0\uAE4C\uC9C0 \uB0AE\uCD94\uC5C8\uB3C4\uB2E4.</td></tr><tr><td style="text-align:left;">\uC5D0\uC2A4\uAC94 31:16</td><td style="text-align:left;">\uB0B4\uAC00 \uADF8\uB97C \uAD6C\uB801\uC73C\uB85C \uB0B4\uB824\uAC00\uB294 \uC790\uB4E4\uACFC \uB354\uBD88\uC5B4 \uC9C0\uC625\uC5D0 \uB358\uC9C8 \uB54C \uADF8\uC758 \uB5A8\uC5B4\uC9C0\uB294 \uC18C\uB9AC\uC5D0 \uBBFC\uC871\uB4E4\uC774 \uC9C4\uB3D9\uD558\uAC8C \uD558\uC600\uC73C\uB2C8, \uC5D0\uB374\uC758 \uBAA8\uB4E0 \uB098\uBB34, \uC989 \uBB3C\uC744 \uD761\uC218\uD55C \uB808\uBC14\uB17C\uC758 \uC544\uB984\uB2F5\uACE0 \uAC00\uC7A5 \uC88B\uC740 \uAC83\uB4E4\uC774 \uB545\uC758 \uC544\uB798 \uBD80\uBD84\uC5D0\uC11C \uC704\uB85C\uBC1B\uAC8C \uB418\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC5D0\uC2A4\uAC94 31:17</td><td style="text-align:left;">\uADF8\uB4E4\uC740 \uB610\uD55C \uADF8\uC640 \uD568\uAED8 \uC9C0\uC625\uC5D0 \uB0B4\uB824\uAC08 \uB54C \uCE7C\uB85C \uC0B4\uD574\uB41C \uC790\uB4E4\uC5D0\uAC8C \uAC14\uC73C\uBA70, \uADF8\uB4E4\uC740 \uADF8\uC758 \uD314\uC774\uC5C8\uACE0 \uC774\uBC29 \uAC00\uC6B4\uB370\uC11C \uADF8\uC758 \uADF8\uB298 \uC544\uB798 \uAC70\uD558\uB358 \uC790\uB4E4\uC774\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uC5D0\uC2A4\uAC94 32:21</td><td style="text-align:left;">\uB9C9\uAC15\uD55C \uC790\uB4E4 \uC0AC\uC774\uC5D0\uC11C \uAC15\uD55C \uC790\uAC00 \uADF8\uB97C \uB3D5\uB294 \uC790\uB4E4\uACFC \uB354\uBD88\uC5B4 \uC9C0\uC625 \uD55C\uAC00\uC6B4\uB370\uC11C \uADF8\uC5D0\uAC8C \uB9D0\uD560 \uAC83\uC774\uB2C8, \uADF8\uB4E4\uC740 \uB0B4\uB824\uC640\uC11C \uCE7C\uB85C \uC0B4\uD574\uB41C \uCC44\uB85C \uD560\uB840 \uBC1B\uC9C0 \uC54A\uACE0 \uB204\uC6CC \uC788\uB3C4\uB2E4.</td></tr><tr><td style="text-align:left;">\uC5D0\uC2A4\uAC94 32:27</td><td style="text-align:left;">\uADF8\uB4E4\uC740 \uD560\uB840 \uBC1B\uC9C0 \uC54A\uC740 \uC790\uB4E4 \uAC00\uC6B4\uB370\uC11C \uC5CE\uB4DC\uB7EC\uC9C4 \uC6A9\uC0AC\uB4E4, \uC989 \uADF8\uB4E4\uC758 \uC804\uC7C1 \uBB34\uAE30\uB97C \uAC00\uC9C0\uACE0 \uC9C0\uC625\uC5D0 \uB0B4\uB824\uAC04 \uC790\uB4E4\uACFC\uB294 \uD568\uAED8 \uB215\uC9C0 \uC544\uB2C8\uD560 \uAC83\uC774\uB2C8, \uADF8\uB4E4\uC740 \uCE7C\uC744 \uC790\uAE30\uB4E4\uC758 \uBA38\uB9AC \uBC11\uC5D0 \uB450\uC5C8\uC73C\uB098 \uADF8\uB4E4\uC774 \uC0B0 \uC790\uB4E4\uC758 \uB545\uC5D0\uC11C\uB294 \uC6A9\uC0AC\uB4E4\uC758 \uB450\uB824\uC6C0\uC77C\uC9C0\uB77C\uB3C4 \uADF8\uB4E4\uC758 \uC8C4\uC545\uC740 \uADF8\uB4E4\uC758 \uBF08 \uC704\uC5D0 \uC788\uC73C\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uC544\uBAA8\uC2A4 9:2</td><td style="text-align:left;">\uADF8\uB4E4\uC774 \uC9C0\uC625\uC73C\uB85C \uD30C\uACE0 \uB4E4\uC5B4\uAC04\uB2E4 \uD560\uC9C0\uB77C\uB3C4 \uB0B4 \uC190\uC774 \uAC70\uAE30\uC11C \uADF8\uB4E4\uC744 \uB04C\uC5B4\uB0BC \uAC83\uC774\uC694, \uADF8\uB4E4\uC774 \uD558\uB298\uAE4C\uC9C0 \uC62C\uB77C\uAC04\uB2E4 \uD560\uC9C0\uB77C\uB3C4 \uB0B4\uAC00 \uAC70\uAE30\uC11C \uADF8\uB4E4\uC744 \uB04C\uC5B4\uB0BC \uAC83\uC774\uB77C.</td></tr><tr><td style="text-align:left;">\uC694\uB098 2:2</td><td style="text-align:left;">\uB9D0\uD558\uAE30\uB97C &quot;\uB0B4\uAC00 \uB098\uC758 \uACE0\uD1B5\uC73C\uB85C \uC778\uD558\uC5EC \uC8FC\uAED8 \uBD80\uB974\uC9D6\uC5C8\uB354\uB2C8 \uC8FC\uAED8\uC11C \uB098\uB97C \uB4E4\uC73C\uC168\uB098\uC774\uB2E4. \uB0B4\uAC00 \uC9C0\uC625\uC758 \uBC43\uC18D\uC73C\uB85C\uBD80\uD130 \uBD80\uB974\uC9D6\uC5C8\uB354\uB2C8 \uC8FC\uAED8\uC11C \uB0B4 \uC74C\uC131\uC744 \uB4E4\uC73C\uC168\uB098\uC774\uB2E4.&quot;</td></tr><tr><td style="text-align:left;">\uD558\uBC15\uAD6D 2:5</td><td style="text-align:left;">\uADF8\uB294 \uAD50\uB9CC\uD55C \uC790\uC774\uBA70 \uB610\uD55C \uC220\uB85C \uC778\uD558\uC5EC \uCC38\uC73C\uB85C \uBC94\uC8C4\uD558\uC600\uAE30\uC5D0 \uC9D1\uC5D0 \uAC00\uB9CC\uC788\uC9C0 \uBABB\uD558\uACE0, \uADF8\uB294 \uC790\uAE30 \uC695\uC2EC\uC744 \uC9C0\uC625\uCC98\uB7FC \uB113\uD788\uBA70 \uC8FD\uC74C\uCC98\uB7FC \uB418\uACE0 \uB9CC\uC871\uD560 \uC904 \uBAA8\uB974\uBA70 \uBAA8\uB4E0 \uBBFC\uC871\uB4E4\uC744 \uC790\uAE30\uC5D0\uAC8C\uB85C \uBAA8\uC73C\uACE0 \uBAA8\uB4E0 \uBC31\uC131\uB4E4\uC744 \uBAA8\uC73C\uB098\uB2C8</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 5:22</td><td style="text-align:left;">\uB0B4\uAC00 \uB108\uD76C\uC5D0\uAC8C \uB9D0\uD558\uB178\uB2C8, \uAE4C\uB2ED \uC5C6\uC774 \uC790\uAE30 \uD615\uC81C\uC5D0\uAC8C \uB178\uD558\uB294 \uC790\uB294 \uB204\uAD6C\uB4E0\uC9C0 \uC2EC\uD310\uC758 \uC704\uD5D8\uC5D0 \uCC98\uD558\uAC8C \uB420 \uAC83\uC774\uBA70, \uD615\uC81C\uC5D0\uAC8C \uB77C\uCE74\uB77C \uD558\uB294 \uC790\uB294 \uB204\uAD6C\uB098 \uACF5\uD68C\uC758 \uC704\uD5D8\uC5D0 \uCC98\uD558\uAC8C \uB420 \uAC83\uC774\uC694, \uB610 \uC5B4\uB9AC\uC11D\uC740 \uC790\uB77C \uD558\uB294 \uC790\uB294 \uB204\uAD6C\uB098 \uC9C0\uC625\uBD88\uC758 \uC704\uD5D8\uC5D0 \uCC98\uD558\uAC8C \uB420 \uAC83\uC774\uB77C.</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 5:29</td><td style="text-align:left;">\uB610 \uB9CC\uC77C \uB108\uC758 \uC624\uB978\uCABD \uB208\uC774 \uB108\uB85C \uC2E4\uC871\uCF00 \uD558\uAC70\uB4E0 \uBE7C\uC5B4 \uB358\uC838 \uBC84\uB9AC\uB77C. \uB124 \uC9C0\uCCB4 \uAC00\uC6B4\uB370 \uD558\uB098\uAC00 \uC190\uC0C1\uB418\uB294 \uAC83\uC774 \uB124 \uC628 \uBAB8\uC774 \uC9C0\uC625\uC5D0 \uB358\uC838\uC9C0\uB294 \uAC83\uBCF4\uB2E4 \uB098\uC73C\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 5:30</td><td style="text-align:left;">\uB610 \uB9CC\uC77C \uB124 \uC624\uB978\uC190\uC774 \uB108\uB85C \uC2E4\uC871\uCF00 \uD558\uAC70\uB4E0 \uC798\uB77C \uB358\uC838 \uBC84\uB9AC\uB77C. \uB124 \uC9C0\uCCB4 \uAC00\uC6B4\uB370 \uD558\uB098\uAC00 \uC190\uC0C1\uB418\uB294 \uAC83\uC774 \uB124 \uC628\uBAB8\uC774 \uC9C0\uC625\uC5D0 \uB358\uC838\uC9C0\uB294 \uAC83\uBCF4\uB2E4 \uB098\uC73C\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 10:28</td><td style="text-align:left;">\uB610 \uB108\uD76C\uB294 \uBAB8\uC740 \uC8FD\uC77C \uC218 \uC788\uC73C\uB098 \uD63C\uC740 \uC8FD\uC774\uC9C0 \uBABB\uD558\uB294 \uC790\uB4E4\uC744 \uB450\uB824\uC6CC\uD558\uC9C0 \uB9D0\uACE0, \uCC28\uB77C\uB9AC \uD63C\uACFC \uBAB8\uC744 \uBAA8\uB450 \uC9C0\uC625\uC5D0\uC11C \uBA78\uD558\uC2E4 \uC218 \uC788\uB294 \uADF8 \uBD84\uC744 \uB450\uB824\uC6CC\uD558\uB77C.</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 11:23</td><td style="text-align:left;">\uAC00\uBC84\uB098\uC6C0\uC544, \uD558\uB298\uAE4C\uC9C0 \uB192\uC544\uC9C4 \uB108\uB294 \uC9C0\uC625\uAE4C\uC9C0 \uB0AE\uC544\uC9C0\uB9AC\uB77C. \uB108\uC5D0\uAC8C \uD589\uD558\uC600\uB358 \uAD8C\uB2A5\uC744 \uC18C\uB3D4\uC5D0\uC11C \uD589\uD558\uC600\uB354\uB77C\uBA74 \uADF8 \uC131\uC74D\uC774 \uC624\uB298\uAE4C\uC9C0 \uB0A8\uC544 \uC788\uC5C8\uC73C\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 16:18</td><td style="text-align:left;">\uB098\uB3C4 \uB108\uC5D0\uAC8C \uB9D0\uD558\uB178\uB2C8, \uB108\uB294 \uBCA0\uB4DC\uB85C\uB77C. \uADF8\uB9AC\uACE0 \uC774 \uBC18\uC11D \uC704\uC5D0 \uB0B4\uAC00 \uB098\uC758 \uAD50\uD68C\uB97C \uC138\uC6B0\uB9AC\uB2C8, \uC9C0\uC625\uC758 \uBB38\uB4E4\uC774 \uADF8\uAC83\uC744 \uC774\uAE30\uC9C0 \uBABB\uD558\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 18:9</td><td style="text-align:left;">\uB610 \uB124 \uB208\uC774 \uB108\uB97C \uC2E4\uC871\uCF00 \uD558\uAC70\uB4E0 \uBF51\uC544 \uB358\uC838 \uBC84\uB9AC\uB77C. \uB450 \uB208\uC744 \uAC00\uC9C0\uACE0 \uC9C0\uC625 \uBD88\uC5D0 \uB358\uC838\uC9C0\uB294 \uAC83\uBCF4\uB2E4 \uD55C \uB208\uC744 \uAC00\uC9C0\uACE0 \uC0DD\uBA85\uC73C\uB85C \uB4E4\uC5B4\uAC00\uB294 \uAC83\uC774 \uB354 \uB098\uC73C\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 23:15</td><td style="text-align:left;">\uC704\uC120\uC790\uC778 \uC11C\uAE30\uAD00\uB4E4\uACFC \uBC14\uB9AC\uC0C8\uC778\uB4E4\uC544, \uB108\uD76C\uC5D0\uAC8C \uD654 \uC788\uC73C\uB9AC\uB77C! \uC774\uB294 \uB108\uD76C\uAC00 \uD55C \uC0AC\uB78C\uC758 \uAC1C\uC885\uC790\uB97C \uC5BB\uC73C\uB824\uACE0 \uBC14\uB2E4\uC640 \uC721\uC9C0\uB97C \uB450\uB8E8 \uB2E4\uB2C8\uB2E4\uAC00 \uC5BB\uACE0 \uB098\uBA74 \uADF8\uB97C</td></tr><tr><td style="text-align:left;">\uB9C8\uD0DC\uBCF5\uC74C 23:33</td><td style="text-align:left;">\uB108\uD76C \uBC40\uB4E4\uC544, \uB3C5\uC0AC\uB4E4\uC758 \uC138\uB300\uC57C, \uC5B4\uB5BB\uAC8C \uB108\uD76C\uAC00 \uC9C0\uC625\uC758 \uC800\uC8FC\uC5D0\uC11C \uD53C\uD560 \uC218 \uC788\uACA0\uB290\uB0D0?</td></tr><tr><td style="text-align:left;">\uB9C8\uAC00\uBCF5\uC74C 9:43</td><td style="text-align:left;">\uB124 \uC190\uC774 \uB108\uB97C \uC2E4\uC871\uCF00 \uD558\uAC70\uB4E0 \uC798\uB77C \uBC84\uB9AC\uB77C. \uB450 \uC190\uC744 \uAC00\uC9C0\uACE0 \uACB0\uCF54 \uAEBC\uC9C0\uC9C0 \uC54A\uB294 \uBD88\uC18D\uC778 \uC9C0\uC625\uC5D0 \uB4E4\uC5B4\uAC00\uB294 \uAC83\uBCF4\uB2E4 \uBD88\uAD6C\uC790\uB85C \uC0DD\uBA85\uC5D0 \uB4E4\uC5B4\uAC00\uB294 \uAC83\uC774 \uB354 \uB098\uC73C\uB2C8</td></tr><tr><td style="text-align:left;">\uB9C8\uAC00\uBCF5\uC74C 9:45</td><td style="text-align:left;">\uB124 \uBC1C\uC774 \uB108\uB97C \uC2E4\uC871\uCF00 \uD558\uAC70\uB4E0 \uC798\uB77C \uBC84\uB9AC\uB77C. \uB450 \uBC1C\uC744 \uAC00\uC9C0\uACE0 \uACB0\uCF54 \uAEBC\uC9C0\uC9C0 \uC54A\uB294 \uBD88 \uC18D\uC778 \uC9C0\uC625\uC5D0 \uB358\uC838\uC9C0\uB294 \uAC83\uBCF4\uB2E4 \uC808\uB984\uBC1C\uC774\uB85C \uC0DD\uBA85\uC5D0 \uB4E4\uC5B4\uAC00\uB294 \uAC83\uC774 \uB354 \uB098</td></tr><tr><td style="text-align:left;">\uB9C8\uAC00\uBCF5\uC74C 9:47</td><td style="text-align:left;">\uB124 \uB208\uC774 \uB108\uB97C \uC2E4\uC871\uCF00 \uD558\uAC70\uB4E0 \uBF51\uC544 \uBC84\uB9AC\uB77C. \uB450 \uB208\uC744 \uAC00\uC9C0\uACE0 \uC9C0\uC625 \uBD88\uC5D0 \uB358\uC838\uC9C0\uB294 \uAC83\uBCF4\uB2E4\uB294 \uD55C \uB208\uC73C\uB85C \uD558\uB098\uB2D8\uC758 \uB098\uB77C\uC5D0 \uB4E4\uC5B4\uAC00\uB294 \uAC83\uC774 \uB354 \uB098\uC73C\uB2C8\uB77C.</td></tr><tr><td style="text-align:left;">\uB204\uAC00\uBCF5\uC74C 10:15</td><td style="text-align:left;">\uB108 \uAC00\uBC84\uB098\uC6C0\uC544, \uB124\uAC00 \uD558\uB298\uAE4C\uC9C0 \uB192\uC544\uC84C\uC73C\uB098 \uC9C0\uC625\uAE4C\uC9C0 \uB04C\uC5B4\uB0B4\uB824\uC9C0\uB9AC\uB77C.</td></tr><tr><td style="text-align:left;">\uB204\uAC00\uBCF5\uC74C 12:5</td><td style="text-align:left;">\uADF8\uB7EC\uB098 \uB108\uD76C\uAC00 \uB204\uAD6C\uB97C \uB450\uB824\uC6CC\uD574\uC57C \uD558\uB294\uC9C0 \uB0B4\uAC00 \uBCF4\uC5EC \uC8FC\uB9AC\uB77C. \uC8FD\uC778 \uD6C4\uC5D0 \uC9C0\uC625\uC5D0 \uB358\uC838 \uB123\uB294 \uAD8C\uC138\uB97C \uAC00\uC9C4 \uADF8 \uBD84\uC744 \uB450\uB824\uC6CC\uD558\uB77C. \uC815\uB155, \uB0B4\uAC00 \uB108\uD76C\uC5D0\uAC8C \uB9D0\uD558\uB178</td></tr><tr><td style="text-align:left;">\uB204\uAC00\uBCF5\uC74C 16:23</td><td style="text-align:left;">\uBD80\uC790\uAC00 \uC9C0\uC625\uC5D0\uC11C \uACE0\uD1B5 \uBC1B\uB294 \uC911\uC5D0 \uB208\uC744 \uB4E4\uC5B4 \uC800 \uBA40\uB9AC \uC544\uBE0C\uB77C\uD568\uC744 \uBCF4\uC558\uB354\uB2C8 \uB098\uC0AC\uB85C\uAC00 \uADF8\uC758 \uD488\uC5D0 \uC788\uB294\uC9C0\uB77C.</td></tr><tr><td style="text-align:left;">\uC0AC\uB3C4\uD589\uC804 2:27</td><td style="text-align:left;">\uC774\uB294 \uC8FC\uAED8\uC11C \uB0B4 \uD63C\uC744 \uC9C0\uC625\uC5D0 \uB0B4\uBC84\uB824 \uB450\uC9C0 \uC544\uB2C8\uD558\uC2DC\uBA70, \uB610 \uC8FC\uC758 \uAC70\uB8E9\uD558\uC2E0 \uBD84\uC774 \uBD80\uD328\uB418\uB294 \uAC83\uC744 \uBCF4\uC9C0 \uC54A\uAC8C \uD558\uC2E4 \uAC83\uC774\uAE30 \uB54C\uBB38\uC774\uB77C.</td></tr><tr><td style="text-align:left;">\uC0AC\uB3C4\uD589\uC804 2:31</td><td style="text-align:left;">\uADF8\uAC00 \uBBF8\uB9AC \uC55E\uC744 \uB0B4\uB2E4\uBD04\uC73C\uB85C \uADF8\uB9AC\uC2A4\uB3C4\uC758 \uBD80\uD65C\uC5D0 \uAD00\uD558\uC5EC \uB9D0\uD558\uB418 &quot;\uC8FC\uC758 \uD63C\uC774 \uC9C0\uC625\uC5D0 \uB0B4\uBC84\uB824\uC9C0\uC9C0 \uC54A\uC558\uC73C\uBA70, \uB610 \uC8FC\uC758 \uC721\uC2E0\uB3C4 \uBD80\uD328\uB418\uB294 \uAC83\uC744 \uBCF4\uC9C0 \uBABB\uD558\uC600\uB3C4\uB2E4</td></tr><tr><td style="text-align:left;">\uC57C\uACE0\uBCF4\uC11C 3:6</td><td style="text-align:left;">\uD600\uB294 \uBD88\uC774\uC694, \uC8C4\uC545\uC758 \uC138\uC0C1\uC774\uB77C. \uADF8\uB7EC\uBBC0\uB85C \uD600\uB294 \uC6B0\uB9AC \uC9C0\uCCB4\uB4E4 \uAC00\uC6B4\uB370 \uC788\uC73C\uBA74\uC11C \uC628 \uBAB8\uC744 \uB354\uB7FD\uD788\uBA70 \uB610 \uC77C\uC0DD\uC744 \uBD88\uD0DC\uC6CC \uBC84\uB9AC\uB098\uB2C8 \uACE7 \uC9C0\uC625\uC758 \uBD88\uC5D0\uC11C \uD0DC\uC6B0\uB290\uB2C8\uB77C</td></tr><tr><td style="text-align:left;">\uBCA0\uB4DC\uB85C\uD6C4\uC11C 2:4</td><td style="text-align:left;">\uD558\uB098\uB2D8\uAED8\uC11C\uB294 \uC8C4\uB97C \uC9C0\uC740 \uCC9C\uC0AC\uB4E4\uC870\uCC28 \uC544\uB07C\uC9C0 \uC54A\uC73C\uC2DC\uACE0 \uC9C0\uC625\uC5D0 \uB358\uC838\uC11C \uD751\uC554\uC758 \uC0AC\uC2AC\uC5D0 \uB0B4\uC5B4\uC8FC\uC5B4 \uC2EC\uD310 \uB54C\uAE4C\uC9C0 \uAC00\uB450\uC5B4 \uB450\uC168\uC73C\uBA70</td></tr><tr><td style="text-align:left;">\uC694\uD55C\uACC4\uC2DC\uB85D 1:18</td><td style="text-align:left;">\uB098\uB294 \uC0B4\uC544 \uC788\uB294 \uC790\uBA70, \uC8FD\uC740 \uC790\uC600\uC73C\uB098 \uBCF4\uB77C, \uC601\uC6D0\uBB34\uAD81\uD1A0\uB85D \uC0B4\uC544 \uC788\uB178\uB77C. \uC544\uBA58. \uB610\uD55C \uB0B4\uAC00 \uC9C0\uC625\uACFC \uC0AC\uB9DD\uC758 \uC5F4\uC1E0\uB4E4\uC744 \uAC00\uC84C\uB178\uB77C.</td></tr><tr><td style="text-align:left;">\uC694\uD55C\uACC4\uC2DC\uB85D 6:8</td><td style="text-align:left;">\uC774\uC5D0 \uB0B4\uAC00 \uBCF4\uB2C8, \uBCF4\uB77C, \uCC3D\uBC31\uD55C \uB9D0 \uD55C \uB9C8\uB9AC\uAC00 \uC788\uB294\uB370 \uADF8 \uC704\uC5D0 \uD0C4 \uC790\uC758 \uC774\uB984\uC740 \uC0AC\uB9DD\uC774\uC694 \uC9C0\uC625\uC774 \uADF8 \uB4A4\uB97C \uB530\uB974\uB2C8, \uADF8\uB4E4\uC5D0\uAC8C \uCE7C\uACFC \uAD76\uC8FC\uB9BC\uACFC \uC0AC\uB9DD\uACFC \uB545\uC758</td></tr><tr><td style="text-align:left;">\uC694\uD55C\uACC4\uC2DC\uB85D 20:14</td><td style="text-align:left;">\uC0AC\uB9DD\uACFC \uC9C0\uC625\uB3C4 \uBD88 \uBABB\uC5D0 \uB358\uC838\uC9C0\uB2C8 \uC774\uAC83\uC774 \uB458\uC9F8 \uC0AC\uB9DD\uC774\uB77C.</td></tr></tbody></table></details><p><em>\uCD9C\uCC98: https://cafe.daum.net/cgsbong</em></p>',5);function a(r,s){return d}var f=e(l,[["render",a]]);export{f as default};
